	    return "<div class=\"dashboard-description-container\">\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <h1>Welcome!</h1>\n      <p>To learn about this web application and to fully benefit from its features, view the BOSS App Tutorial by clicking the \"Show Tutorial\" button at the top of this page.\n         Otherwise, scroll to the bottom of this page to view student records or to begin an observation session.\n      </p>\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n\n      <h2>What is Behavior Observation of Students in Schools (BOSS)?</h2>\n      <p>BOSS is a systematic observation method that is conducted by categorizing behavior at a specific interval of time. The process is best illustrated using an example. When a school counselor is asked to observe a particular student using BOSS, the observer enters the classroom with the\n        goal of making an observation every 15 seconds over 40 intervals (i.e., a 10 minute session). At the end of each 15-second interval, the counselor categories the student’s behavior into at least one of the following behavior categories:\n      </p>\n      <ol>\n        <li>Actively Engaged Time (AET) - e.g. answering a teacher’s question</li>\n        <li>Passively Engaged Time (PET) - e.g. reading an assigned passage</li>\n        <li>Off-Task Motor (OFT-M) - e.g. tapping a pen</li>\n        <li>Off-Task Verbal (OFT-V) - e.g. talking to a friend\n        </li>\n        <li>Off-Task Passive (OFT-P) - e.g. staring out the window</li>\n      </ol>\n    </div>\n  </div>\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-sm-offset-1 col-sm-10\">\n      <p>Next, in order to be able to compare the target student to the rest of the class, data needs to be collected for random peers as well. For this reason, at every 5th interval, the observer directs his attention to a random student and categorizes\n        his or her behavior during that interval.</p>\n      <p>For example, the individual being observed for the first 10 intervals would be:</p>\n    </div>\n  </div>\n  <div class=\"row extra-padding-top\">\n    <div class=\"col-sm-5 col-sm-offset-1 col-xs-offset-0 col-xs-12\">\n      <p class=\"center-label\">TS = Target Student</p>\n    </div>\n    <div class=\"col-sm-5 col-sm-offset-1 col-xs-offset-0 col-xs-12\">\n      <p class=\"center-label\">RP = Random Peer</p>\n    </div>\n  </div>\n  <div class=\"row extra-padding-bottom\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <table class=\"table\">\n        <tr>\n          <td>Interval</td>\n          <td>1</td>\n          <td>2</td>\n          <td>3</td>\n          <td>4</td>\n          <td class=\"highlight\">5</td>\n          <td class=\"hidden-xs\">6</td>\n          <td class=\"hidden-xs\">7</td>\n          <td class=\"hidden-xs\">8</td>\n          <td class=\"hidden-xs\">9</td>\n          <td class=\"hidden-xs highlight\">10</td>\n        </tr>\n        <tr>\n          <td>Student</td>\n          <td>TS</td>\n          <td>TS</td>\n          <td>TS</td>\n          <td>TS</td>\n          <td class=\"highlight\">RP</td>\n          <td class=\"hidden-xs\">TS</td>\n          <td class=\"hidden-xs\">TS</td>\n          <td class=\"hidden-xs\">TS</td>\n          <td class=\"hidden-xs\">TS</td>\n          <td class=\"hidden-xs highlight\">RP</td>\n        </tr>\n      </table>\n\n      <p>At the end of the 10 minutes, the observer will have 40 data points of behavior. 32 of the data points reflect the behavior of the target student and 8 of the data points (which was collected every 5th interval) represent the behavior of random\n        peers.\n      </p>\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <h2>Web Application Required Steps</h2>\n      <ol>\n        <li>Create a Student</li>\n        <li>Create a Session</li>\n        <li>Observe Student</li>\n        <li>Generate Report</li>\n      </ol>\n      <p>To view an existing student record or session report, click \"View Students\". Otherwise, select \"Create Session\" to get started.</p>\n      <div class=\"dashboard-container\">\n        <button id=\"dashboard-home-btn\" type=\"button\" class=\"btn btn-primary\">View Students</button>\n        <button id=\"dashboard-new-session-btn\" type=\"button\" class=\"btn btn-success\">Create Session</button>\n      </div>\n    </div>\n  </div>\n</div>\n";
