	module.exports = (Handlebars["default"] || Handlebars).template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
	    return "<span class=\"sign-up-welcome\">\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <h3>Welcome New User!</h3>\n      <p>Thank you for signing up!  It is recommended that you read the web application tutorial below before proceeding.  To leave the tutorial, click the orange \"Close Tutorial\" button, which is located at the top of this page and at the end of the tutorial.</p>\n      <hr class=\"hr-sub-divide\">\n    </div>\n  </div>\n</span>\n\n\n<div class=\"row\">\n  <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10 boss-header-container\">\n    <div class=\"boss-header-container\">\n      <h1>BOSS Tutorial</h1>\n      <!-- <span class=\"sign-up-welcome\">\n      <h3>Welcome New User!</h3>\n      <p>Thank you for signing up!  It is recommended that you read the web application tutorial below before proceeding.  To leave the tutorial, click the orange \"Close Tutorial\" button, which is located at the top of this page and at the end of the tutorial.</p>\n\n          <hr class=\"hr-sub-divide\">\n\n    </span> -->\n    </div>\n  </div>\n</div>\n\n<div class=\"row\">\n  <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n    <div>\n      <h2>Getting Started</h3>\n      <ol>\n        <li>Create a Student</li>\n        <li>Create a Session</li>\n        <li>Observe Student</li>\n        <li>Generate Report</li>\n      </ol>\n    </div>\n  </div>\n</div>\n<div class=\"row\">\n  <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n    <hr class=\"hr-divide\">\n  </div>\n</div>\n<div class=\"row\">\n  <!-- <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10 col-md-offset-1 col-md-5\"> -->\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <h2>Step 1 - Create a Student</h2>\n      <p>All sessions and observations must be associated with a student. Therefore, the first step is to create a student. When completing the create student form, a user must include a student's first name and last name. All other fields are optional.</p>\n    </div>\n  </div>\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <div class=\"tutorial-image-container-single\">\n        <p class=\"image-caption\">Create a Student</p>\n        <img src=\"https://cloud.githubusercontent.com/assets/13546265/25741847/a959b974-315a-11e7-831e-ecd905105fbb.png\" alt=\"Create Student Screenshot\">\n      </div>\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <hr class=\"hr-divide\">\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <h2>Step 2 - Create a Session</h2>\n      <p>All observation sessions are associated with a student record. <span class=\"highlight-red\">A student can have many sessions associated with his or her account</span>. To create a session, a user must complete the create session form. In this form,\n        the session setting, session task, number of intervals, and length of intervals (in seconds) are required. In addition, a total session time calculator is provided at the bottom of this form for the user's convenience. It is recommended that at\n        least 40 intervals be measured at 15-second intervals to ensure that the data is valid and reliable. There are two ways in which to create a session:</p>\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <h3>Create Session - Option 1</h3>\n      <p>First, you can view the record of the student whom you wish to observe. Then, select the \"Create Session\" button below the student record (as indicated in the image).</p>\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <div class=\"tutorial-image-container-single\">\n        <p class=\"image-caption\">Create Session - Option 1</p>\n        <img src=\"https://cloud.githubusercontent.com/assets/13546265/25742308/d739d02a-315c-11e7-89de-74d61990e920.png\" alt=\"Create Session Option 1\">\n      </div>\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <hr class=\"hr-sub-divide\">\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <h3>Create Session - Option 2</h3>\n      <p>The second option is to go to the Student Record homepage where all student records are listed. Then, two additional steps are required:</p>\n      <p>First, click on the \"Create Sessions\" button (Option 2 - Part A).</p>\n      <p>After you complete this task, you will see a page which offers two options. The first is to create a student, which is required if there is no student record created for the individual you will be observing. However, if a student record already\n        exists, you can click \"Existing Student\". This displays a list of all student records. From here, simply click \"Select Student\" from the row of the student whom you will be observing (Option 2 - Part B).</p>\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10 col-md-offset-1 col-md-5\">\n      <div class=\"tutorial-image-container\">\n        <p class=\"image-caption\">Create Session - Option 2A</p>\n        <img src=\"https://cloud.githubusercontent.com/assets/13546265/25742658/6fcf66aa-315e-11e7-996b-0d438be16244.png\" alt=\"Create Session Option 2a\">\n      </div>\n    </div>\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10 col-md-5 col-md-offset-0\">\n      <div class=\"tutorial-image-container\">\n        <p class=\"image-caption\">Create Session - Option 2B</p>\n        <img src=\"https://cloud.githubusercontent.com/assets/13546265/25744197/8a9fa212-3166-11e7-8466-2c162d69f5ae.png\" alt=\"Create Session Option 2b\">\n      </div>\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <hr class=\"hr-divide\">\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <h2>Step 3 - Observe Student</h3>\n      <p>After creating a session record, you are ready to start observing.</p>\n      <h3>Submitting an Observation</h3>\n      <p>Please note that <span class=\"highlight-red\">all observations are automatically submitted at the end of each interval</span>.  Therefore, no action is required to store the results of an interval.</p>\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <hr class=\"hr-sub-divide\">\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <h3>Start Timer</h3>\n      <p>When you are ready to begin observing, click the \"Start Timer\" button. When clicked, the timer will start counting down by the interval you included in the sessions create form.</p>\n    </div>\n  </div>\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <div class=\"tutorial-image-container-single\">\n        <p class=\"image-caption\">Start Timer</p>\n        <img src=\"https://cloud.githubusercontent.com/assets/13546265/25744399/bcec05c0-3167-11e7-911e-487aec6fa5e2.png\" alt=\"Start Timer\">\n      </div>\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <hr class=\"hr-sub-divide\">\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <h3>Time Interval Indicators</h3>\n      <p>There are two indicators for the time remaining in a given interval. The first lists the number of seconds remaining before the response is recorded. The second is a time bar which decreases in size as the interval comes to an end. This bar also changes color from green to red depending on the time remaining in an interval.</p>\n    </div>\n  </div>\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <div class=\"tutorial-image-container-single\">\n        <p class=\"image-caption\">Time Bar &amp; Countdown</p>\n        <img src=\"https://cloud.githubusercontent.com/assets/13546265/25786396/5db5f56e-3362-11e7-9240-702a7e71de10.png\" alt=\"Time Interval Indicators\">\n      </div>\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <hr class=\"hr-sub-divide\">\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <h3>Target Student vs. Random Peer Indicators</h3>\n      <p>BOSS requires a random peer to be observed every 5th interval. There are two indicators to help the observer monitor which student to observe. First, either \"Observing: Target Student\" or \"Observing: Random Peer\" will appear above the timer countdown. In addition, the background color changes depending on the student being observed.  If the user is observing the target student during an interval, the written indicator will have a black font and white background.  <span class=\"highlight-red\">If the user is observing the random peer, however, both the written indicator and background color will change to orange</span>. This decreases the likelihood that the observer will make the common mistake of observing the wrong student during a given interval.</p>\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10 col-md-offset-1 col-md-5\">\n      <div class=\"tutorial-image-container\">\n        <p class=\"image-caption\">Observing Target Student</p>\n        <img src=\"https://cloud.githubusercontent.com/assets/13546265/25787120/ae344a18-336c-11e7-812c-f90c7ec784a7.png\" alt=\"Target vs. Random Peer Indicators\">\n      </div>\n    </div>\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10 col-md-5 col-md-offset-0\">\n      <div class=\"tutorial-image-container\">\n        <p class=\"image-caption\">Observing Random Peer</p>\n        <img src=\"https://cloud.githubusercontent.com/assets/13546265/25786474/d1a276ea-3363-11e7-9b0a-4e6867ecaba3.png\" alt=\"Target vs. Random Peer Indicators\">\n      </div>\n    </div>\n  </div>  <div class=\"row\">\n      <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n        <hr class=\"hr-sub-divide\">\n      </div>\n    </div>\n\n    <div class=\"row\">\n      <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n        <h3>Selecting Behavior Type(s) During an Interval</h3>\n        <p>A behavior type (i.e. off-task motor, actively engaged, etc.) can have two possible values - yes and no.  \"Yes\" implies that a behavior type was observed during a time interval.  \"No\" implies that\n          the behavior was not seen.  <span class=\"highlight-red\">It is important to note that at the begining of <u>every time interval</u>, the value of each behavior type resets to \"No\".</span>  \"No\" is also the default value and every behavior type will receive a value of \"No\" unless the user changes a value to \"Yes\".</p>\n      </div>\n    </div>\n\n    <div class=\"row\">\n      <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10 col-md-offset-1 col-md-5\">\n        <div class=\"tutorial-image-container\">\n          <p class=\"image-caption\">Default Value is \"No\"</p>\n          <img src=\"https://cloud.githubusercontent.com/assets/13546265/25790682/cec3265c-3388-11e7-9720-54e4cf291106.png\" alt=\"Updating Submission - Step 1\">\n        </div>\n      </div>\n      <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10 col-md-5 col-md-offset-0\">\n        <div class=\"tutorial-image-container\">\n          <p class=\"image-caption\">User Observed \"Off-Task Verbal\" and clicks \"Yes\"</p>\n          <img src=\"https://cloud.githubusercontent.com/assets/13546265/25790681/cec2f4ac-3388-11e7-9c64-979d7bf6aecc.png\" alt=\"Updating Submission - Step 2\">\n        </div>\n      </div>\n    </div>\n\n    <div class=\"row\">\n      <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10 col-md-offset-1 col-md-5\">\n        <div class=\"tutorial-image-container\">\n          <p class=\"image-caption\">User Selects \"Off-Task Passive\" by Clicking \"Yes\"</p>\n          <img src=\"https://cloud.githubusercontent.com/assets/13546265/25790683/cec6dd9c-3388-11e7-9ae0-f1e0ebca8953.png\" alt=\"Updating Submission - Step 3\">\n        </div>\n      </div>\n      <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10 col-md-5 col-md-offset-0\">\n        <div class=\"tutorial-image-container\">\n          <p class=\"image-caption\">User Deselects \"Off-Task Passive\" by Clicking \"No\"</p>\n          <img src=\"https://cloud.githubusercontent.com/assets/13546265/25790684/ced58f86-3388-11e7-9a43-4f7c01902ca9.png\" alt=\"Updating Submission - Step 4\">\n        </div>\n      </div>\n    </div>\n\n    <div class=\"row\">\n      <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n        <div class=\"tutorial-image-container-single\">\n          <p class=\"image-caption\">All Values Submitted as \"No\" with Exception to \"Off-Task Verbal\"</p>\n          <img src=\"https://cloud.githubusercontent.com/assets/13546265/25790685/ced605ce-3388-11e7-838f-5dbf3efcb0ce.png\" alt=\"Updating Submission - Step 4\">\n        </div>\n      </div>\n    </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <hr class=\"hr-sub-divide\">\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <h3>Updating the Last Submission</h3>\n      <p>If an error is made by the observer when recording the observed behavior, the user can update the previous interval's submission.  Note that <span class=\"highlight-red\">a user is able to update the last submission without affecting the current interval or interrupting the observation session.</span></p>\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <h4>Desktop Version</h4>\n      <p>Updating the previous interval's entry can be accomplished by clicking the \"edit\" button for the last submission table. At this point, the observer can check a box if a behavior was observed, or uncheck a box if the behavior was not observed. <span class=\"highlight-red\">In order for the update to be saved, the observer must click the \"submit\" button below the update form.</span></p>\n        <p>Update Example With Screenshots\n        <ol>\n          <li>Click edit at bottom of last submission table</li>\n          <li>View Options - In this example, off-task motor and off-task verbal are selected.</li>\n          <li>Select/Deselect Categories - We wish to change the submission from off-task motor and off-task verbal to passively engaged and off-task verbal.  Because off-task\n              verbal is already selected, we only need to select passively engaged and off-task verbal, both of which can be accomplished by simply clicking the box in the appropriate row.\n              Lastly, we must click \"Submit Update\" for the changes to be saved.\n            </li>\n        </ol>\n      </p>\n    </div>\n\n\n    <div class=\"row\">\n      <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10 col-md-offset-1 col-md-5\">\n        <div class=\"tutorial-image-container\">\n          <p class=\"image-caption\">Step 1 - Click Edit</p>\n          <img src=\"https://cloud.githubusercontent.com/assets/13546265/25786842/4d41f7a8-3369-11e7-8549-0c6c0781deb7.png\" alt=\"Updating Submission - Step 1\">\n        </div>\n      </div>\n      <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10 col-md-5 col-md-offset-0\">\n        <div class=\"tutorial-image-container\">\n          <p class=\"image-caption\">Step 2 - View Options</p>\n          <img src=\"https://cloud.githubusercontent.com/assets/13546265/25786845/4d4948dc-3369-11e7-9f4a-6396b5fa534b.png\" alt=\"Updating Submission - Step 2\">\n        </div>\n      </div>\n    </div>\n\n    <div class=\"row\">\n      <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10 col-md-offset-1 col-md-5\">\n        <div class=\"tutorial-image-container\">\n          <p class=\"image-caption\">Step 3 - Select/Deselect Category</p>\n          <img src=\"https://cloud.githubusercontent.com/assets/13546265/25786843/4d45db70-3369-11e7-9e3d-a669248aeb37.png\" alt=\"Updating Submission - Step 3\">\n        </div>\n      </div>\n      <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10 col-md-5 col-md-offset-0\">\n        <div class=\"tutorial-image-container\">\n          <p class=\"image-caption\">Update Confirmation</p>\n          <img src=\"https://cloud.githubusercontent.com/assets/13546265/25786844/4d461c8e-3369-11e7-87b0-1e1da1c9f723.png\" alt=\"Updating Submission - Step 4\">\n        </div>\n      </div>\n    </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <hr class=\"hr-sub-divide\">\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <h4>Mobile Version</h4>\n      <p>Updating the last entry on a phone or table requires a user to click the\n      \"Edit Last Submission\" button.  When clicked, a dropdown will appear and the observer can update the last entry by selecting or deselecting a box.  Please note\n      that <span class=\"highlight-red\">an observer must click the \"Submit\" button in order for the update to be saved</span>.</p>\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-3 col-md-offset-1 col-md-3\">\n      <div class=\"tutorial-image-container-mobile\">\n        <p class=\"image-caption\">Original Submission</p>\n        <img src=\"https://cloud.githubusercontent.com/assets/13546265/25791299/639a26d2-338d-11e7-9f7f-f4ac7d5d41ba.png\" alt=\"Updating Submission - Step 1\">\n      </div>\n    </div>\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-0 col-sm-3 col-md-3 col-md-offset-0\">\n      <div class=\"tutorial-image-container-mobile\">\n        <p class=\"image-caption\">Edit Last Submission Button</p>\n        <img src=\"https://cloud.githubusercontent.com/assets/13546265/25791300/639ab638-338d-11e7-9684-692e196c6699.png\" alt=\"Updating Submission - Step 2\">\n      </div>\n    </div>\n      <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-0 col-sm-3 col-md-offset-0 col-md-3\">\n        <div class=\"tutorial-image-container-mobile\">\n          <p class=\"image-caption\">Hide Dropdown</p>\n          <img src=\"https://cloud.githubusercontent.com/assets/13546265/25791297/6396bce0-338d-11e7-99c2-1809659f5731.png\" alt=\"Updating Submission - Step 3\">\n        </div>\n      </div>\n    </div>\n\n    <div class=\"row\">\n      <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-3 col-md-offset-1 col-md-3\">\n        <div class=\"tutorial-image-container-mobile\">\n          <p class=\"image-caption\">Edit Dropdown</p>\n          <img src=\"https://cloud.githubusercontent.com/assets/13546265/25791301/639c3c6a-338d-11e7-8cc2-ee22930178e4.png\" alt=\"Updating Submission - Step 4\"></div>\n      </div>\n      <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-0 col-sm-3 col-md-3 col-md-offset-0\">\n        <div class=\"tutorial-image-container-mobile\">\n          <p class=\"image-caption\">Original Submission Values</p>\n          <img src=\"https://cloud.githubusercontent.com/assets/13546265/25791302/639c3f30-338d-11e7-9119-e62038e1dd4e.png\" alt=\"Updating Submission - Step 3\">\n        </div>\n      </div>\n        <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-0 col-sm-3 col-md-offset-0 col-md-3\">\n          <div class=\"tutorial-image-container-mobile\">\n            <p class=\"image-caption\">Changing &amp; Submitting Values</p>\n            <img src=\"https://cloud.githubusercontent.com/assets/13546265/25791298/63992d4a-338d-11e7-9c84-7995d6309496.png\" alt=\"Updating Submission - Step 4\">\n          </div>\n        </div>\n      </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <hr class=\"hr-sub-divide\">\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <h3>Blank Submission Warning</h3>\n      <p>The web application warns a user if an interval was submitted without any category being selected.  The warning differs depending on whether the observer is using the desktop or mobile version.</p>\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <div class=\"tutorial-image-container-single\">\n        <p class=\"image-caption\">Blank Submission Warning</p>\n        <img src=\"https://cloud.githubusercontent.com/assets/13546265/25786554/62c735b0-3365-11e7-801e-631674f8b800.png\" alt=\"No Submission Warning\">\n      </div>\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <hr class=\"hr-sub-divide\">\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <h4>Desktop Version</h4>\n      <p>If an interval ends without at least one category being selected, <span class=\"highlight-red\">the background of the last entry table turns red</span>. This increases the likelihood that an observe will notice that nothing was submitted for a previous interval. If this occurs, the observer can update the last submission as described above.</p>\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10 col-md-offset-1 col-md-5\">\n      <div class=\"tutorial-image-container\">\n        <p class=\"image-caption\">Step 1</p>\n        <img src=\"https://cloud.githubusercontent.com/assets/13546265/25786551/62b52b40-3365-11e7-984a-d3c2c44c1f2f.png\" alt=\"No Submission Step 1\">\n      </div>\n    </div>\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10 col-md-5 col-md-offset-0\">\n      <div class=\"tutorial-image-container\">\n        <p class=\"image-caption\">Step 2</p>\n        <img src=\"https://cloud.githubusercontent.com/assets/13546265/25786553/62c601fe-3365-11e7-987e-7974697c13d6.png\" alt=\"No Submission Step 2\">\n      </div>\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10 col-md-offset-1 col-md-5\">\n      <div class=\"tutorial-image-container\">\n        <p class=\"image-caption\">Step 3</p>\n        <img src=\"https://cloud.githubusercontent.com/assets/13546265/25786552/62b5ba24-3365-11e7-93d4-2257006ed712.png\" alt=\"No Submission Step 3\">\n      </div>\n    </div>\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10 col-md-5 col-md-offset-0\">\n      <div class=\"tutorial-image-container\">\n        <p class=\"image-caption\">Update Submission Confirmation</p>\n        <img src=\"https://cloud.githubusercontent.com/assets/13546265/25786555/62c8563e-3365-11e7-84de-fa6f8ece59f0.png\" alt=\"No Submission Confirmation\">\n      </div>\n    </div>\n  </div>\n\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <hr class=\"hr-sub-divide\">\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <h4>Mobile Version</h4>\n      <p>For the mobile version, the user is notified by the color of the button for updating the last submission.  Specifically, <span class=\"highlight-red\">the \"Edit Last Submission\" button turns red</span>.  If this occurs, the observer can update the last submission as described above.</p>\n\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-3 col-md-offset-1 col-md-3\">\n      <div class=\"tutorial-image-container-mobile\">\n        <p class=\"image-caption\">Valid Submission - Blue Button</p>\n        <img src=\"https://cloud.githubusercontent.com/assets/13546265/25792163/e7629710-3392-11e7-8058-3e3d5735a53d.png\" alt=\"Updating Submission - Step 1\">\n      </div>\n    </div>\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-0 col-sm-3 col-md-3 col-md-offset-0\">\n      <div class=\"tutorial-image-container-mobile\">\n        <p class=\"image-caption\">Blank Submission - Red Button</p>\n        <img src=\"https://cloud.githubusercontent.com/assets/13546265/25792159/e760c250-3392-11e7-9011-a22db2295bbb.png\" alt=\"Updating Submission - Step 2\">\n      </div>\n    </div>\n      <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-0 col-sm-3 col-md-offset-0 col-md-3\">\n        <div class=\"tutorial-image-container-mobile\">\n          <p class=\"image-caption\">Edit Button to Update</p>\n          <img src=\"https://cloud.githubusercontent.com/assets/13546265/25792161/e7616624-3392-11e7-996e-540684e0b0f1.png\" alt=\"Updating Submission - Step 3\">\n        </div>\n      </div>\n    </div>\n\n    <div class=\"row\">\n      <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-3 col-md-offset-1 col-md-3\">\n        <div class=\"tutorial-image-container-mobile\">\n          <p class=\"image-caption\">Result of Clicking Edit</p>\n          <img src=\"https://cloud.githubusercontent.com/assets/13546265/25792160/e7612fd8-3392-11e7-9dd7-61a686851686.png\" alt=\"Updating Submission - Step 4\"></div>\n      </div>\n      <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-0 col-sm-3 col-md-3 col-md-offset-0\">\n        <div class=\"tutorial-image-container-mobile\">\n          <p class=\"image-caption\">Select &amp; Submit Observation From Last Interval</p>\n          <img src=\"https://cloud.githubusercontent.com/assets/13546265/25792162/e761c998-3392-11e7-9393-84c3ae8dec3b.png\" alt=\"Updating Submission - Step 3\">\n        </div>\n      </div>\n        <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-0 col-sm-3 col-md-offset-0 col-md-3\">\n          <div class=\"tutorial-image-container-mobile\">\n            <p class=\"image-caption\">Post Update Confirmation - Blue Button</p>\n            <img src=\"https://cloud.githubusercontent.com/assets/13546265/25792163/e7629710-3392-11e7-8058-3e3d5735a53d.png\" alt=\"Updating Submission - Step 4\">\n          </div>\n        </div>\n      </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <hr class=\"hr-divide\">\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <h2>Step 4 - Generate Report</h2>\n      <p>A session report is automatically generated immediately after the last interval of an observation session. See below for instructions on how to view a report at a later time.</p>\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <h3>Viewing a Report</h3>\n      <p>To view the report at a later date, simply view the student profile and session record. Then, click the \"Generate Report\" button.</p>\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <div class=\"tutorial-image-container-single\">\n        <p class=\"image-caption\">Generate Report</p>\n        <img src=\"https://cloud.githubusercontent.com/assets/13546265/25792414/848a4e2e-3394-11e7-8229-0e33d2db24a5.png\" alt=\"View Report Screenshot\">\n      </div>\n    </div>\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-offset-1 col-sm-10\">\n      <div class=\"center well\">\n        <button class=\"btn btn-warning tutorial-btn\">Close Tutorial</button>\n      </div>\n    </div>\n  </div>\n";
	},"useData":true});

