	    return "\n  <div class=\"row\">\n    <div class=\"col-xs-12 col-xs-offset-0 col-sm-10 col-sm-offset-1\">\n      <h1>Create Session Form</h1>\n      <form class=\"form sessions-form max-xs\" id=\"new-session-form\" name=\"new-session-form\">\n        <fieldset>\n          <p id=\"create-session-error\"></p>\n          <p>All fields are <u>optional</u> unless otherwise indicated</p>\n\n          <div class=\"form-group\">\n            <label>Session Date</label>\n            <input id=\"session-date-create-field\" class=\"form-control\" name=\"session[obs_on]\" placeholder=\"Session Date\" type=\"date\">\n          </div>\n\n          <div class=\"form-group setting-field-container\">\n            <label>Session Setting (required)</label>\n            <div class=\"setting-field-notification\"></div>\n            <input name=\"session[obs_setting]\" class=\"form-control setting-required\" placeholder=\"Session Setting\" type=\"text\">\n          </div>\n\n          <div class=\"form-group task-field-container\">\n            <label>Session Task (required)</label>\n            <div class=\"task-field-notification\"></div>\n            <input name=\"session[obs_task]\" class=\"form-control task-required\" placeholder=\"Session Task\" type=\"text\">\n          </div>\n\n          <div class=\"form-group intervals-field-container\">\n            <label>Number of Intervals (required) - between 1 and 60</label>\n            <div class=\"intervals-field-notification\"></div>\n            <input id=\"interval-number-entry\" class=\"form-control intervals-required\" name=\"session[int_num]\" placeholder=\"Number of Intervals\" type=\"text\" value=\"40\">\n          </div>\n\n          <div class=\"form-group length-field-container\">\n            <label>Length of Intervals in seconds (required) - between 5 and 30 seconds</label>\n            <div class=\"length-field-notification\"></div>\n            <input id=\"interval-length-entry\" class=\"form-control length-required\" name=\"session[obs_time]\" placeholder=\"Time\" type=\"text\" value=\"15\">\n          </div>\n\n          <div class=\"form-group\">\n            <label>Session Comment</label>\n            <input name=\"session[comment]\" class=\"form-control\" placeholder=\"Comment\" type=\"text\">\n          </div>\n\n          <p class=\"total-session-time-calculator\"><label>Total Session Time Calculator</label></p>\n          <p class=\"total-session-time\">A session with <span class=\"number-of-intervals-entry\">40</span> intervals measured every <span class=\"length-of-intervals-entry\">15</span> seconds will take <span class=\"highlight-time\"><span id=\"total-session-time-m\">10</span> minutes and\n            <span id=\"total-session-time-s\">0</span> seconds</span>\n            to complete.</p>\n\n          <div class=\"form-group submit-btn-container\">\n            <input id=\"create-session-btn\" class=\"current btn btn-success submit-btn\" name=\"submit\" type=\"submit\" value=\"Submit\" data-current-student-id=\"\">\n            <button class=\"btn btn-danger submit-btn current session-cancel-btn\" data-current-student-id=\"\" data-current-session-id=\"0\">Cancel</button>\n          </div>\n\n        </fieldset>\n      </form>\n      <div class=\"dashboard-container well max-xs\">\n        <button id=\"dashboard-home-btn\" type=\"button\" class=\"btn btn-primary\">View Students</button>\n      </div>\n    </div>\n  </div>\n";
